import { Button, Tooltip } from 'antd';
import { CheckOutlined, RollbackOutlined } from '@ant-design/icons';

import { connect } from 'react-redux';
import React from 'react'

import * as Filter from '../../constants/filter'

const MoveTodo = ({ moveTodo, active}) => {

    return (
        <Tooltip placement="top" title={ active === Filter.COMPLETED ? 'Move To Todo': 'Move To Completed' }>
             <Button type="link" onClick={moveTodo} >
                { active === 'COMPLETED' ? <RollbackOutlined />:  <CheckOutlined />  }
             </Button>
        </Tooltip>
    )
}

const  mapStateToProps = (ref) => {
    return { active: ref.todos.visibilityFilter };
  }

export default connect(mapStateToProps)(MoveTodo)
